void asn1Copy_s1ap_ReportingCellList (OSCTXT* pctxt, 
   const s1ap_ReportingCellList* pSrcValue, s1ap_ReportingCellList* pDstValue)
{
   if (pSrcValue == pDstValue)
      return;

   {
      OSUINT32 xx1 = 0;
      s1ap_ReportingCellList_Item* pSrcData;
      OSRTDListNode* pnode;

      rtxDListInit (pDstValue);
      for (pnode = pSrcValue->head; pnode != 0 && xx1 < pSrcValue->count; pnode = pnode->next) {
         s1ap_ReportingCellList_Item* pDstData = rtxMemAllocTypeZ (pctxt, s1ap_ReportingCellList_Item);
         pSrcData = ((s1ap_ReportingCellList_Item*)pnode->data);

         asn1Copy_s1ap_ReportingCellList_Item (pctxt, pSrcData, pDstData);

         rtxDListAppend (pctxt, pDstValue, (void*)pDstData);
         xx1++;
      }
   }

   return;
}

